{
  "translationLines": [
    {
      "lineNumber": 165751,
      "originalJapaneseLine": "「あ、ご、ごめんなさい……",
      "translatedEnglishLine": "\"Ah, s-sorry...\""
    },
    {
      "lineNumber": 165752,
      "originalJapaneseLine": "　驚かせちゃったかしら……」",
      "translatedEnglishLine": "Did I scare you, I wonder...\""
    },
    {
      "lineNumber": 165753,
      "originalJapaneseLine": "「見たところ普通の子に見えるけど、",
      "translatedEnglishLine": "\"At first glance, you look like an ordinary girl,"
    },
    {
      "lineNumber": 165754,
      "originalJapaneseLine": "　なんだってこんな場所に……？」",
      "translatedEnglishLine": "but what are you doing in a place like this...?\""
    },
    {
      "lineNumber": 165755,
      "originalJapaneseLine": "「そそそ、そ、そ、そ……」",
      "translatedEnglishLine": "\"S-s-s-so, so, so...\""
    },
    {
      "lineNumber": 165756,
      "originalJapaneseLine": "「ん？」",
      "translatedEnglishLine": "\"Hm?\""
    },
    {
      "lineNumber": 165757,
      "originalJapaneseLine": "（あうあう、な、何か！　何か言わないと！）",
      "translatedEnglishLine": "(Auw auw, s-something! I have to say something!)"
    },
    {
      "lineNumber": 165758,
      "originalJapaneseLine": "「そ……そ……」",
      "translatedEnglishLine": "\"So... so...\""
    },
    {
      "lineNumber": 165759,
      "originalJapaneseLine": "「そ、の……」",
      "translatedEnglishLine": "\"Th-that...\""
    },
    {
      "lineNumber": 165760,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"........................\""
    },
    {
      "lineNumber": 165761,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"........................\""
    },
    {
      "lineNumber": 165762,
      "originalJapaneseLine": "（だ、黙っちゃった……！）",
      "translatedEnglishLine": "(Sh-she’s gone silent...!)"
    },
    {
      "lineNumber": 165763,
      "originalJapaneseLine": "「えと……誰かのところにご用？",
      "translatedEnglishLine": "\"Um... Are you here to see someone?"
    },
    {
      "lineNumber": 165764,
      "originalJapaneseLine": "　どなたか兵士のご家族とか……」",
      "translatedEnglishLine": "Are you perhaps family of a soldier...?\""
    },
    {
      "lineNumber": 165765,
      "originalJapaneseLine": "（い、言え！　私！",
      "translatedEnglishLine": "(S-say it! Me!"
    },
    {
      "lineNumber": 165766,
      "originalJapaneseLine": "　はっきりと言ってやれ！）",
      "translatedEnglishLine": "Say it clearly!)"
    },
    {
      "lineNumber": 165767,
      "originalJapaneseLine": "「あう、い、いえっ……",
      "translatedEnglishLine": "\"Auw, n-no...\""
    },
    {
      "lineNumber": 165768,
      "originalJapaneseLine": "　あくっ……う……」",
      "translatedEnglishLine": "Ack... ugh...\""
    },
    {
      "lineNumber": 165769,
      "originalJapaneseLine": "「え？　なに？」",
      "translatedEnglishLine": "\"Huh? What?\""
    },
    {
      "lineNumber": 165770,
      "originalJapaneseLine": "「総統閣下のお部屋はどこでしょうか！？",
      "translatedEnglishLine": "\"Where is the Supreme Leader's room!?\""
    },
    {
      "lineNumber": 165771,
      "originalJapaneseLine": "「あう……耳、キーンって……」",
      "translatedEnglishLine": "\"Auw... my ears are ringing...\""
    },
    {
      "lineNumber": 165772,
      "originalJapaneseLine": "「ランス……じゃなくて、",
      "translatedEnglishLine": "\"Lance... no, I mean,"
    },
    {
      "lineNumber": 165773,
      "originalJapaneseLine": "　総統のお部屋はここを真っ直ぐ行って、",
      "translatedEnglishLine": "the Supreme Leader's room is straight ahead here,"
    },
    {
      "lineNumber": 165774,
      "originalJapaneseLine": "　突き当たりを右に曲がったところよ」",
      "translatedEnglishLine": "then turn right at the end of the hall.\""
    },
    {
      "lineNumber": 165775,
      "originalJapaneseLine": "「ありっ、ありがと……ござ……」",
      "translatedEnglishLine": "\"Th-thank y-you...\""
    },
    {
      "lineNumber": 165776,
      "originalJapaneseLine": "最後の方はボソボソ声で聞こえなかったが、",
      "translatedEnglishLine": "The last part was murmured and inaudible,"
    },
    {
      "lineNumber": 165777,
      "originalJapaneseLine": "かなみは笑顔で頷いておいた。",
      "translatedEnglishLine": "Kanami nodded with a smile."
    },
    {
      "lineNumber": 165778,
      "originalJapaneseLine": "「そ、それじゃ……っ」",
      "translatedEnglishLine": "\"W-well then...\""
    },
    {
      "lineNumber": 165779,
      "originalJapaneseLine": "ニミッツはぺこっと頭を下げると",
      "translatedEnglishLine": "Nimitz bowed his head politely,"
    },
    {
      "lineNumber": 165780,
      "originalJapaneseLine": "こそこそとその場から逃げた。",
      "translatedEnglishLine": "and sneaked away from the spot."
    },
    {
      "lineNumber": 165781,
      "originalJapaneseLine": "「ふーん……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 165782,
      "originalJapaneseLine": "「今夜のお相手はあの子なんだ……」",
      "translatedEnglishLine": "\"That’s the girl tonight’s partner...\""
    },
    {
      "lineNumber": 165783,
      "originalJapaneseLine": "「くすん……」",
      "translatedEnglishLine": "\"Sniff...\""
    },
    {
      "lineNumber": 165784,
      "originalJapaneseLine": "「いいの……私は愛に生きるの……",
      "translatedEnglishLine": "\"It's okay... I live for love..."
    },
    {
      "lineNumber": 165785,
      "originalJapaneseLine": "　ランスが幸せならいいじゃない……」",
      "translatedEnglishLine": "As long as Lance is happy...\""
    },
    {
      "lineNumber": 165786,
      "originalJapaneseLine": "「ぐっすん……しくしく……」",
      "translatedEnglishLine": "\"Sniffle... sob...\""
    },
    {
      "lineNumber": 165787,
      "originalJapaneseLine": "「さっ、私も街中の見回りに参加しましょ……",
      "translatedEnglishLine": "\"Well then, I’ll join the patrol in the city..."
    },
    {
      "lineNumber": 165788,
      "originalJapaneseLine": "　未確認情報だけど、街に魔人が",
      "translatedEnglishLine": "It's unconfirmed information, but a demon might"
    },
    {
      "lineNumber": 165789,
      "originalJapaneseLine": "　入り込んだかもって言うし……」",
      "translatedEnglishLine": "have snuck into the city...\""
    },
    {
      "lineNumber": 165790,
      "originalJapaneseLine": "「行きましょうか、カオスさん」",
      "translatedEnglishLine": "\"Shall we go, Chaos?\""
    },
    {
      "lineNumber": 165791,
      "originalJapaneseLine": "「あいあいー。",
      "translatedEnglishLine": "\"Aye aye—"
    },
    {
      "lineNumber": 165792,
      "originalJapaneseLine": "　儂の力で魔人なんか見つけたるよー」",
      "translatedEnglishLine": "I’ll find any demons with my power—\""
    },
    {
      "lineNumber": 165793,
      "originalJapaneseLine": "かなみに抱えられたカオスは、",
      "translatedEnglishLine": "Chaos, being carried by Kanami,"
    },
    {
      "lineNumber": 165794,
      "originalJapaneseLine": "元気一杯な顔をすぐに歪めた。",
      "translatedEnglishLine": "quickly twisted his lively face."
    },
    {
      "lineNumber": 165795,
      "originalJapaneseLine": "「と、言いたいんだが……」",
      "translatedEnglishLine": "\"Th-that’s what I want to say, but...\""
    },
    {
      "lineNumber": 165796,
      "originalJapaneseLine": "「なーんか変なのよねー」",
      "translatedEnglishLine": "\"Something feels weird, you know—\""
    },
    {
      "lineNumber": 165797,
      "originalJapaneseLine": "「すぐ近くにいるような気もするし……",
      "translatedEnglishLine": "\"I feel like it’s very close by..."
    },
    {
      "lineNumber": 165798,
      "originalJapaneseLine": "　この辺にはいない気もするし……」",
      "translatedEnglishLine": "But I also feel like it’s not around here...\""
    },
    {
      "lineNumber": 165799,
      "originalJapaneseLine": "「？　とりあえずまずは足で捜してみましょう」",
      "translatedEnglishLine": "\"Hmm? For now, let’s search on foot first.\""
    },
    {
      "lineNumber": 165800,
      "originalJapaneseLine": "「ほいほい、行ってみよ」",
      "translatedEnglishLine": "\"Alright, let's go.\""
    },
    {
      "lineNumber": 165801,
      "originalJapaneseLine": "かなみ達はランスに魔人が",
      "translatedEnglishLine": "Kanami and the others returned to the patrol"
    },
    {
      "lineNumber": 165802,
      "originalJapaneseLine": "近づかないようにする為の、見回りに戻った。",
      "translatedEnglishLine": "to keep demons away from Lance."
    },
    {
      "lineNumber": 165803,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 165804,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 165805,
      "originalJapaneseLine": "あれこれあって、",
      "translatedEnglishLine": "After various things,"
    },
    {
      "lineNumber": 165806,
      "originalJapaneseLine": "ようやくニミッツはランスの部屋に辿り着いた。",
      "translatedEnglishLine": "Nimitz finally reached Lance’s room."
    },
    {
      "lineNumber": 165807,
      "originalJapaneseLine": "「この中に……あの男が……」",
      "translatedEnglishLine": "\"Inside here... that man is...\""
    },
    {
      "lineNumber": 165808,
      "originalJapaneseLine": "胸元をさぐれば、",
      "translatedEnglishLine": "He reached into his chest,"
    },
    {
      "lineNumber": 165809,
      "originalJapaneseLine": "そこには尖り光る一本のナイフがある。",
      "translatedEnglishLine": "and there was a sharp, shining knife there."
    },
    {
      "lineNumber": 165810,
      "originalJapaneseLine": "「大丈夫……大丈夫……",
      "translatedEnglishLine": "\"It’s alright... it’s alright...\""
    }
  ]
}

